            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "Get the First and List indexes for a message with the pool returned\n"
                },
                {
                  "kind": "span",
                  "text": "by the Get_Pool function.  The text of associated message is simply\n"
                }
              ]
            },
            {
              "kind": "code",
              "children": [
                {
                  "number": 1,
                  "children": [
                    {
                      "kind": "span",
                      "text": "Pool := Get_Pool (Catalog);"
                    }
                  ]
                },
                {
                  "number": 2,
                  "children": [
                    {
                      "kind": "span",
                      "text": "Query_Message_Indexes (Catalog, 1, 10, 3,"
                    }
                  ]
                },
                {
                  "number": 3,
                  "children": [
                    {
                      "kind": "span",
                      "text": "                       First, Last);"
                    }
                  ]
                },
                {
                  "number": 4,
                  "children": [
                    {
                      "kind": "span",
                      "text": "Msg := Pool (First .. Last);"
                    }
                  ]
                },
                {
                  "number": 5,
                  "children": [
                    {
                      "kind": "span",
                      "text": ""
                    }
                  ]
                }
              ]
            },
            {
              "kind": "paragraph",
              "children": [
                {
                  "kind": "span",
                  "text": "All the messages within a catalog can be queried by iterating over\n"
                },
                {
                  "kind": "span",
                  "text": "the facilities, keys and locales using the Number_Of_* functions.\n"
                },
                {
                  "kind": "span",
                  "text": "Note, this procedure will raise exceptions for non-existant data,\n"
                },
                {
                  "kind": "span",
                  "text": "e.g., \"myfac1\" might not contain data for the locale \"fr_FR\" while\n"
                },
                {
                  "kind": "span",
                  "text": "facility \"myfac2\" might.\n"
                }
              ]
            }
